import { FixedNumber } from 'ethers';
import React, { useEffect } from 'react';
import '../css/stylesheet.css';

const Score = ({setScore, setEnded, setHeight, setBottom, score, ended, setNftPage, bottom}) => {

    const fn = (event) => {
        event.preventDefault();
        const delay1 = setTimeout(changeNftPage1, 10000);
        function changeNftPage1() {
            setNftPage(true);
            clearInterval(delay1);
        };

        const delay2 = setTimeout(changeNftPage2, 10000);
        function changeNftPage2() {
            console.log('running2')
            setNftPage(true);
            clearInterval(delay2);
        };
    }

    useEffect(() => {
    }, [score, ended])

    if (!ended){
        return (
            <>
                <div className="highscore_div">
                    highScore
                </div>
                <div className="score_div">
                    {score}
                </div>
            </>
        )
    }
    else if (bottom) {
        return(
            <>
                <div className="highscore_div">
                    highScore
                </div>
                <div className="score_div">
                    {score}
                </div>
                <div className="gameover">
                    You're Trash
                </div>
                <button type="button" className="nft_button" onClick={ event => {
                    fn();
                }}>
                   Get NFT!
                </button>
                <button type="button" className="play_again_button1" onClick={ event => {
                    event.preventDefault();
                    setScore(0);
                    setEnded(false);
                    setHeight(100);
                    setBottom(false);
                }}>
                   Play
                </button>
            </>
        )
    }
    else {
        return(
            <>
                <div className="highscore_div">
                    highScore
                </div>
                <div className="score_div">
                    {score}
                </div>
                <button type="button" className="nft_button" onClick={ event => {
                    event.preventDefault();
                    const delay1 = setTimeout(changeNftPage1, 800);
                    function changeNftPage1() {
                        setNftPage(true);
                        clearInterval(delay1);
                    };
                }}>
                   Get NFT!
                </button>
                <button type="button" className="play_again_button1" onClick={ event => {
                    event.preventDefault();
                    setScore(0);
                    setEnded(false);
                    setHeight(100);
                    setBottom(false);
                }}>
                   Play
                </button>
            </>
        )
    }
}

export default Score;
